 /** 	 * {@inheritDoc} 	 *  	 * @since 1.5 	 */  @Override  public void addNewModelElements(EObject eObject, EReference eReference) {  final Collection<EClass> classes = EMFUtils.getSubClasses(eReference.getEReferenceType());  final SelectionComposite<TreeViewer> helper = CompositeFactory.getSelectModelClassComposite(  new HashSet<EPackage>(),  new HashSet<EPackage>(), classes);  final EObject newMEInstance = SelectModelElementWizardFactory.openCreateNewModelElementDialog(helper);  if (newMEInstance == null) {  return; } } 
